const Topics = ({ topic }) => {
    const { id, name, logo, } = topic;

    return (
        <div className='bg-light p-2'>
            <div className='border'>
                <img className='img-fluid' src={logo} alt={name} />
                <h6>{name}</h6>
                <button>practice</button>
            </div>
        </div>
    );
};

export default Topics;
